import Button from "./Button"

function Row({money}){


    const rows=money.map((transaction,index)=>{
        return(
            <>
            <tr key={index+1}>
                <td>{transaction.date}</td>
                <td>{transaction.description}</td>
                <td>{transaction.category}</td>
                <td>{transaction.amount}</td>
                <td><Button></Button> value="delete"<Button/></td>
            </tr>
            </>
        )

    })
    return(
        <>
        {rows}
        </>
    )

}
export default Row
